import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    '& > *': {
      marginTop: theme.spacing(1),
      width: '100%',
    },
  },
  login: {
  	width: '100%',
  	maxWidth: 400,
  	display: 'block',
  	margin: '50px auto'
  }
}))
